import { useEffect, useState } from "react";
import axios from "axios";

type CallError = {
    message: string;
    code: string;
}

// Axios options taken from Adion apiClient.ts
const token = 'eyJ0eXAiOiJKV1QiLCJhbGciOiJSUzI1NiJ9..4hLgqv1KqdQxXsYEkdbt0XpR7kIlv7iS35U9R4BMjF5zUMCaqUFOJFziuR_HXoEFXndILLQ6NswfzXIsgPrwTFkLpJ93O8_N41KDLPlZ-Y6wd6WUlcRhWcQfbooh3c9H-mXhs4GquKjBGIZFwSOwng804vmp6RSz1qXLge7QDjYYaXKJqWDkG1WB8tih0iDjLtGZ_s_Pzy0V1PsllNJ8pOvux5nYqXlNcoiamXD0rh8DENwUFssRnCcM6uc9epSMLv_iXQhPAalA5vsAoWaLEPfuqWqoMiFIohAIfC6UTVwA0FMxiBNWFqQNPQi9BOkFG87EG2RoEPTZZd6DhEK3GQ'
const options = {
  withCredentials: true,
  headers: {
    'X-Api-Key': `Bearer ${token}`,
    // This is for htpasswd on pre production environment
    Authorization: 'Basic ZXhvdGljY2E6dmlhamVzMjAxMw==',
  },
};

const useSchema = (url: string) => {
  const [schemaData, setSchemaData] = useState<RuleSchema[]>([]);
  const [isLoading, setLoading] = useState<boolean>(true);
  const [error, setError] = useState<CallError | undefined>();

  useEffect(() => {
    const fetchSchema = async () => {
      try {
        console.log(options);
        const { data } = await axios.get(url, options);
        setSchemaData(data);
      } catch (error) {
        setError(error as CallError);
      }

      setLoading(false);
    };
    fetchSchema();
  }, [url]);

  return { schemaData, isLoading, error };
};

export default useSchema;
